        static public void ScoreRandomiser(string filepath, Random rng)
        {
            string[] editedLua = File.ReadAllLines(filepath);

            int lineNum = 0;
            int rankC = rng.Next(1, 5001);
            int rankB = rng.Next(rankC, 25001);
            int rankA = rng.Next(rankB, 45001);
            int rankS = rng.Next(rankA, 50001);
            foreach (string line in editedLua)
            {
                if (line.Contains("timebonus_base"))
                {
                    string[] timeBonusArray = editedLua[lineNum].Split(' ');
                    timeBonusArray[4] = rng.Next(20000, 60001).ToString();
                    editedLua[lineNum] = (string.Join(" ", timeBonusArray)) + ",";
                }
                if (line.Contains("timebonus_rate"))
                {
                    string[] timeBonusArray = editedLua[lineNum].Split(' ');
                    timeBonusArray[4] = rng.Next(10, 81).ToString();
                    editedLua[lineNum] = (string.Join(" ", timeBonusArray)) + ",";
                }
                if (line.Contains("ringbonus_rate"))
                {
                    string[] ringBonusArray = editedLua[lineNum].Split(' ');
                    ringBonusArray[4] = rng.Next(0, 501).ToString();
                    editedLua[lineNum] = (string.Join(" ", ringBonusArray)) + ",";
                }
                if (line.Contains("rank_c"))
                {
                    string[] rankCArray = editedLua[lineNum].Split(' ');
                    rankCArray[4] = rankC.ToString();
                    editedLua[lineNum] = (string.Join(" ", rankCArray)) + ",";
                }
                if (line.Contains("rank_b"))
                {
                    string[] rankBArray = editedLua[lineNum].Split(' ');
                    rankBArray[4] = rankB.ToString();
                    editedLua[lineNum] = (string.Join(" ", rankBArray)) + ",";
                }
                if (line.Contains("rank_a"))
                {
                    string[] rankAArray = editedLua[lineNum].Split(' ');
                    rankAArray[4] = rankA.ToString();
                    editedLua[lineNum] = (string.Join(" ", rankAArray)) + ",";
                }
                if (line.Contains("rank_s"))
                {
                    string[] rankSArray = editedLua[lineNum].Split(' ');
                    rankSArray[4] = rankS.ToString();
                    editedLua[lineNum] = (string.Join(" ", rankSArray)) + ",";
                }
                lineNum++;
            }
            File.WriteAllLines(filepath, editedLua);
        }
